/**
 * 最小覆盖子串
 *
 * 给你一个字符串 s 、一个字符串 t 。
 * 返回 s 中涵盖 t 所有字符的最小子串。
 * 如果 s 中不存在涵盖 t 所有字符的子串，则返回空字符串 "" 。
 *
 * 注意：
 * 对于 t 中重复字符，我们寻找的子字符串中该字符数量必须不少于 t 中该字符数量。
 * 如果 s 中存在这样的子串，我们保证它是唯一的答案。
 *
 * 示例 1：
 * 输入：s = "ADOBECODEBANC", t = "ABC"
 * 输出："BANC"
 * 解释：最小覆盖子串 "BANC" 包含来自字符串 t 的 'A'、'B' 和 'C'。
 *
 * 示例 2：
 * 输入：s = "a", t = "a"
 * 输出："a"
 * 解释：整个字符串 s 是最小覆盖子串。
 *
 * 示例 3:
 * 输入: s = "a", t = "aa"
 * 输出: ""
 * 解释: t 中两个字符 'a' 均应包含在 s 的子串中，
 * 因此没有符合条件的子字符串，返回空字符串。
 */
class MinWindow {

    /**
     * 老规矩，凭直觉
     *
     * 1. 要找到很容易，for一遍就行，但是【最短】这个要求，怎么办呢？
     *
     * 结论：整段垮掉，搞不定啊！！！直觉不管用了...
     *
     * 貌似可以，但是，对于大文本，效率太低了，超时了都...
     */
    fun solution(s: String, t: String): String {
        // 记录，哪些元素，已经被包含了
        val check: MutableList<Pair<Char, Int>> = mutableListOf()
        for (index in s.indices) {
            // 如果包含，就记录下来
            if (t.contains(s[index])) {
                check.add(s[index] to index)
            }
        }

        // 如果小于，肯定不符合
        if (check.size < t.length) return ""

        // return check.toString()

        // 以上，只能确认，有没有，不能确定最短

        // 以例1为案例，包含，字串的，以下几种情况
        "ADOBECODEBANC" to "ABC"
        "ADOBEC"
        "BECODEBA"
        "CODEBA"
        "BANC"
        // 这里，我们，再次尝试，把所有，的包含t的，在分类，然后，找 最短的
        // 需要，2个指针， 处理 check
        var start = 0
        var end = 0

        // [ABC] 用来验证，是否3个都满了，
        // 所以，1，要队列，2要去重，3要能取到头元素
        // 简单点，用数组，来稿
        val queue: MutableList<Char> = mutableListOf()

        // 这里的box
        var box: MutableList<Char> = t.toMutableList()

        val results = mutableListOf<String>()

        // 遍历 check // [(A, 0), (B, 3), (C, 5), (B, 9), (A, 10), (C, 12)]
        while (end < check.size) {
            val (c, i) = check[end]
            // 添加的话，需要个数，顺序，重复之类的
            // 这用删除尝试
            box.remove(c)
            // 自增
            end += 1
            // 判断，满了
            if (box.isEmpty()) {
                // 记录
                val temp = s.substring(check[start].second, i + 1)
                results.add(temp)
                // 重置 box
                box = t.toMutableList()
                // 下标增加
                start += 1
                end = start
            }
        }

        if (results.isEmpty()) return ""
        if (results.size == 1) return results.first()

        var r = results[0]
        for (i in 1..results.lastIndex) {
            if (results[i].length < r.length) r = results[i]
        }
        return r
        return results.minBy { it.length }
    }

    /**
     * 放弃了，看指导吧...
     * 唉，这还是【2023这一波重温】的第一次放弃，窝囊啊...
     *
     * 先看暴力解法
     */
    fun solution2(s: String, t: String): String {
        // 特殊判断
        if (s.length < t.length) return ""
        if (s.length == 1 && t.length == 1) {
            return if (s == t) s else ""
        }
        // 开始识别
        var result = s + "123"
        val all = t.toCharArray()
        for (i in 0..s.lastIndex) {
            for (j in i + 1..s.lastIndex) {
                val temp = s.substring(i, j + 1)
                // 这里有问题，无法直接使用contains来判断，
                val flag = all.all { temp.contains(it) }
                if (flag) {
                    if (temp.length < result.length) {
                        result = temp
                    }
                }
            }
        }
        return if (result == s + "123") "" else result
    }

    /**
     * 在[solution2]的基础上尝试，核心的问题是，如何判断，s全部包含t？
     * 把 t -> map<char,int> 前者是字符，后者是出现的次数，只要全部对得上，就算包含，但可想而知，会有大量的重复计算
     * 可以尝试，建立，缓存池，来减少计算。
     * 比如，12345，可以建立成，[i..j) map(1-1),map(1-1,2-1),map(1-1,2-1,3-1),
     * 刚开始，先一直扩大，累加，直到第一次满足，保存，
     * 然后，固定这个窗口宽度，往右移动(右边累加，左边递减)，每走一步，计算一次是否满足，直到末尾。
     * 起始这里的思路，已经很像【滑动窗口】的思路了，还差一点什么呢？？？
     *
     * 但是暴力算法的通病是：思路很直接，但是显然，这个算法的复杂度【肯定】大于 O(N^2) 了，不好。
     */
    fun solution3(s: String, t: String): String {
        // 这个是目标值，即，所有char的各自的出现的次数
        val target = t.groupingBy { it }.eachCount().also { println(it) }

        // 创建一个区间，不断去判断，是否满足目标值
        var start = 0
        var end = t.length
        // 记录值
        var result = ""
        // 前缀，也没用，无法进行，Map的加减乘除
//        val prefix = Array<HashMap<Char, Int>>(s.length + 1) { hashMapOf() }
//        for (i in s.indices) {
//            val map = prefix[i]
//            val count = map.getOrPut(s[i]) { 0 }
//            map[s[i]] = count + 1
//            prefix[i + 1] = map
//        }
        while (end <= s.length) {
            // 每次截取，
            val sub = s.substring(start, end)
            // 这里统计，超时了，还是得进行优化...
            val subCount = sub.groupingBy { it }.eachCount()
            val isCover = isCover(subCount, target)
            if (isCover) {
                // 记录
                if (result == "") {
                    result = sub
                } else {
                    if (result.length > sub.length) {
                        result = sub
                    }
                }
                // 区间移动
                start += 1
                end = start + 1
            }
            // end 不断前进
            end += 1
        }
        return result
    }

    /**
     * 判断是否，完全涵盖
     * map1 >= map2
     */
    private fun isCover(map1: Map<Char, Int>, map2: Map<Char, Int>): Boolean {
        map2.forEach { (t, u) ->
            if (map1.getOrDefault(t, 0) < u) {
                return false
            }
        }
        return true
    }

    /**
     * 彻底放弃了，还是看教程吧...
     *
     * 滑动窗口的思想，其实[solution3]的注释说明，已经很接近了，
     * 只是，代码中，没有实现出来，左边递减的这个逻辑！！！
     */
    fun solution4(s: String, t: String): String {
        // 初始化2个map
        val need: MutableMap<Char, Int> = mutableMapOf()
        // t.groupingBy { it }.eachCount().also { println(it) }.toMutableMap()
        // 下面这个循环效果，等同于上面的函数
        for (c in t) {
            need[c] = need.getOrDefault(c, 0) + 1
        }
        println(need)
        val window: MutableMap<Char, Int> = mutableMapOf()

        // 建立窗口范围(即，区间，左闭右开)
        var left = 0
        var right = 0
        // 已经满足个数要求的字符数，当it==t.length的时候，就符合要求了
        var valid = 0 // 我之前想着，要把map全部过一遍，才能判断相等，这里只记录一个总数，就行了【果然方便！！！】
        // 记录最小覆盖子串的起始索引及长度
        var start = 0
        var len = Int.MAX_VALUE
        while (right < s.length) {
            // 目标char
            val cr = s[right]
            // 准备更新
            if (need.contains(cr)) { // 注意，这里是，先更新，后判断
                // 更新windows
                window[cr] = window.getOrDefault(cr, 0) + 1
                // 更新满足字符数，只有【相等】时，才+1
                if (window[cr]!! == need[cr]!!) {
                    valid += 1
                }
            }
            // 扩大窗口
            right += 1

            // 缩小，才是关键，才能准确判断出，最小值！！！
            // 更新是否全部覆盖，然后收紧，即，缩小窗口
            while (valid == need.size) {
                // 更新最小覆盖子串
                if (right - left < len) {
                    start = left
                    len = right - left
                }
                // 目标char
                val cl = s[left]
                // 准备更新
                if (need.contains(cl)) { // 注意，这里是，先判断，后更新
                    // 只有【相等】时，才-1
                    if (window[cl]!! == need[cl]!!) {
                        valid -= 1
                    }
                    // 更新windows
                    window[cl] = window[cl]!! - 1
                }
                // 缩小窗口
                left += 1
            }
        }
        return if (len == Int.MAX_VALUE) "" else s.substring(start, start + len)
    }
}

